import '../stylesheet/header.scss';
const Header = (props) => {
  const handleClick = () => {
    console.log('me han clicado');
  };
  return (
    <div>
      <h1 className="title" onClick={handleClick}>
        {props.title}
      </h1>
      <nav>
        <ul>
          <li>Home</li>
          <li>Quienes somos</li>
          <li>Contacto</li>
        </ul>
      </nav>
    </div>
  );
};
export default Header;
